export const ADD_NEW_RECIPE = 'ADD_NEW_RECIPE';
export const SET_RECIPES = 'SET_RECIPES'

export const addNewRecipeReducer = (recipe) => ({
    type: ADD_NEW_RECIPE,
    payload: recipe,
})

export const setRecipesWithAPI = (recipes) => ({
    type: SET_RECIPES,
    payload: recipes,
})
